import React from 'react';
import logo from './logo.svg';
import './App.scss';


const Header = () => (
    <header>
    <img src={logo} alt="logo"/>
    <h1>Winery</h1> <br/> 
    <h1>Disfuta el momento!</h1>
    </header>
) 

export default Header;
